" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Hyperpigmentation of nails in primary adrenal insufficiency",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 232px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Fingers of a 28-year-old white woman with Addison's disease (underneath) compared to those of a normal woman (top). There is hyperpigmentation of the skin and increased pigmentation of the distal half of the nails that occurred during the period of adrenal insufficiency. The proximal half of the nails are hypopigmented, a reflection of the reduction in ACTH secretion after the institution of glucocorticoid therapy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of David N Orth, MD.",
"    </div>",
"   </div>",
