"       <td class=\"centered\">",
"        I",
"       </td>",
"       <td class=\"centered\">",
"        T1, N0, M0",
"       </td>",
"       <td class=\"centered\">",
"        T1, N0, M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        II",
"       </td>",
"       <td class=\"centered\">",
"        T2, N0, M0",
"       </td>",
"       <td class=\"centered\">",
